import React from "react";
import Container from "./Container";

const ErrorModal = (props) => {
  return (
    <div>
      <Container>
        <div>
          <h1>Oops, incorrect entry!</h1>
        </div>
      </Container>
    </div>
  );
};

export default ErrorModal;
